import React from 'react'

function App() {

  const DATA = [['Monday', 20], ['Tuesday', 21], ['Wednesday', 17], ['Thursday', 16], ['Friday', 25], ['Saturday', 24], ['Sunday', 30]];

  return (
    <div className="App">
      <table>
        <thead>
          <tr>37°C </tr>
          <span className="sun"></span>
        </thead>
        <tbody>
          {DATA.map(pair => {
            return (
              <tr>
                <td>{pair[0]}</td>
                <td>{pair[1]}°C</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
